  Future<void> convert(String htmlContent, String name) async {
    final font = await rootBundle.load("assets/fonts/Roboto-Regular.ttf");
    final ttf = pw.Font.ttf(font);

    final pdf = pw.Document(); // pw = pdf widgets (import below)


    // Convert HTML to widgets
    final htmlToPdf = pdfw.HTMLToPdf();
    final List<pw.Widget> widgets = await htmlToPdf.convert(htmlContent);

    // Add to PDF
    pdf.addPage(pw.MultiPage(
      build: (context) => widgets,
    ));

    pdf.addPage(
      pw.MultiPage(
        theme: pw.ThemeData.withFont(
          base: ttf,
        ),
        build: (context) => widgets,
      ),
    );


    // Save to file
    final outputDir = await _localPath; // Assuming you already have this
    final file = File('$outputDir/$name.pdf');
    await file.writeAsBytes(await pdf.save());

    print('PDF saved to: ${file.path}');

    // Show success message
    ScaffoldMessenger.of(context).showSnackBar(SnackBar(
      content: Text('PDF saved to: ${file.path}'),
    ));
  }

  Future<String?> get _localPath async {
    Directory? directory;
    try {
      if (Platform.isIOS) {
        directory = await getApplicationSupportDirectory();
      } else {
        // if platform is android
        directory = Directory('/storage/emulated/0/Download');
        if (!await directory.exists()) {
          directory = await getExternalStorageDirectory();
        }
      }
    } catch (err) {
      print("Can-not get download folder path");
    }
    return directory?.path;
  }

